property.code:
(function ()
{
  var checkbox = $('PhenoTips.VCF_0_consent');
// can break, but this is a hack anyways
  var checkboxHolder = new Element('label');
  checkbox.insert({before: checkboxHolder});
  checkboxHolder.insert(
    {
      top: checkbox, bottom: "${escapetool.javascript($services.localization.render('phenotips.vcf.consent'))}" +
    " (for example, with the PhenomeCentral consent form" +
    " <a target='_blank' href=\"$xwiki.getDocument('PhenoTips.VCF').getAttachmentURL('phenomecentral_consent.pdf')\">available here</a>)"
    });

  var consentChecked = checkbox.checked;

  var uploadButton = $('PhenoTips.VCF_0_filename_container').down('a.add-data-button');
  var cloneButton = new Element('a', {'class': 'add-data-button button manage-images-button disabled initialized'})
    .update('Upload and manage');
  uploadButton.insert({after: cloneButton});
  cloneButton.hide();
  if (!consentChecked) {
    uploadButton.hide();
    cloneButton.show();
  }

  checkbox.observe('change', function(event) {
    var consentChecked = checkbox.checked;
    if (!consentChecked) {
      uploadButton.hide();
      cloneButton.show();
    } else {
      uploadButton.show();
      cloneButton.hide();
    }
  })
})();

